(14,'Footer About us','<h3 class=\"section-header section-title\">About Us</h3>\r\n       <p>Hosting Billing is a client management and invoicing system for <strong>web hosting</strong>\r\n and domain registration resellers. It comes packed with features that \r\nare designed to automate your daily tasks, saving you time and money.&nbsp;</p>','rich_text','Custom','Block'),
