insert  into `hd_posts`(`id`,`title`,`slug`,`pubdate`,`body`,`post_type`,`user_id`,`category_id`,`created`,`modified`,`parent_id`,`status`,`menu`,`sidebar_right`,`sidebar_left`,`order`,`option`) values 
(1,'Home','home','2020-05-16','<div class=\"row\">\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\">\r\n                            <div style=\"text-align: center;\">\r\n                                <img src=\"data:image/png;base64,\" data-filename=\"backup_icon.png\" data-nsfw-filter-status=\"sfw\" style=\"width: 60px; visibility: visible;\">\r\n                            </div>\r\n                            <h2 style=\"text-align: center; \">Instant Setup<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">As soon as you make a successful payment your web hosting and domain names will be activated immediately. We do not charge extra fees for setting up your account.</h3>\r\n                        </div>\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\">\r\n                            <div style=\"text-align: center;\">\r\n                                <img src=\"data:image/png;base64,\" data-filename=\"backup_icon.png\" style=\"width: 60px; visibility: visible;\" data-nsfw-filter-status=\"sfw\">\r\n                            </div>\r\n                            <h2 style=\"text-align: center; \">Constant Backups<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">Your hosting account is backed up daily going 2 months back at no extra cost. We use dedicated backup servers, providing fast &amp; easy individual file rollback abilities.</h3>\r\n                        </div>\r\n                    </div>\r\n                    <div class=\"row\">\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\"><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"git_icon.png\" style=\"width: 60px; visibility: visible;\" data-nsfw-filter-status=\"sfw\"></div>\r\n                            <h2 style=\"text-align: center; \">GIT/SVN Support<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">Web Developers love using version control systems. All our hosting accounts can use GIT &amp; SVN command line tools on our servers. Simply request SSH access to get started.</h3>\r\n                        </div>\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\"><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"script_icon.png\" style=\"width: 60px; visibility: visible;\" data-nsfw-filter-status=\"sfw\"></div>\r\n                            <h2 style=\"text-align: center; \">280+ Install Scripts<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">All our hosting accounts allow you to install popular software such as Wordpress, Drupal, Joolma and Magento in one easy step. Upgrading your software is just as easy!</h3>\r\n                        </div>\r\n                    </div>\r\n                    <div class=\"row\">\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\"><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"cpanel_icon.png\" style=\"width: 60px; visibility: visible;\" data-nsfw-filter-status=\"sfw\"></div>\r\n                            <h2 style=\"text-align: center; \">cPanel Included<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">All hosting accounts come with the latest version of cPanel. This makes life easy for you to do routine tasks such as setting up email addresses and managing MySQL databases.</h3>\r\n                        </div>\r\n                        <div class=\"col-sm-6 wow fadeInUp white-color\"><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"php_icon.png\" style=\"width: 60px; visibility: visible;\" data-nsfw-filter-status=\"sfw\"></div>\r\n                            <h2 style=\"text-align: center; \">Latest PHP &amp; MySQL<br><br></h2>\r\n                            <h3 data-nsfw-filter-status=\"swf\">Our network runs the latest stable and secure versions of PHP &amp; MySQL. We also implement strict security and firewall rules to protect your website from unwanted visitors 24/7.</h3>\r\n                        </div>\r\n                    </div>','page',1,0,'2020-05-12 05:41:45','2021-06-30 17:23:01',0,1,1,0,0,0,NULL),
